import React from "react";

const FilterTask = (props) => {
  const { filter, toggleFilter } = props;

  return (
    <div>
      <p className="txt">Filter Tasks</p>
      <div className="box">
        <input
          type="checkbox"
          className="box1"
          checked={filter.pending}
          onChange={() => toggleFilter("pending")}
        />
        <label>Pending</label>
        <input
          type="checkbox"
          className="box1"
          checked={filter.inProgress}
          onChange={() => toggleFilter("inProgress")}
        />
        <label>In Progress</label>
        <input
          type="checkbox"
          className="box1"
          checked={filter.done}
          onChange={() => toggleFilter("done")}
        />
        <label>Done</label>
      </div>
    </div>
  );
};

export default FilterTask;
